import React from 'react'

export default function TicTacToe() {

    function qq () {
        let x = document.getElementById('q');
        x.disabled = true;
        x.style.backgroundColor = "orange"
    }


    return (
        <div className='container mt-5 p-4'>
            <div class="row row-cols-3 text-center">
                <button disabled={false} id='q' class="fs-2 btn btn-outline-primary col" onClick={qq}>Column</button>
                <button class="fs-2 btn btn-outline-primary col">Column</button>
                <button class="fs-2 btn btn-outline-primary col">Column</button>
                <button class="fs-2 btn btn-outline-primary col">Column</button>
                <button class="fs-2 btn btn-outline-primary col">Column</button>
                <button class="fs-2 btn btn-outline-primary col">Column</button>
                <button class="fs-2 btn btn-outline-primary col">Column</button>
                <button class="fs-2 btn btn-outline-primary col">Column</button>
                <button class="fs-2 btn btn-outline-primary col">Column</button>
            </div>
        </div>
    )
}
